function Me(){
    const [me,setMe]= useState({
        "id": "",
        "username": "",
        "password_digest": "",
        "patient_id": ""
    })
    useEffect(()=>{
        fetch('/me')
        .then(resp=> resp.json())
        .then(data => setMe(data))
      },[])

    return (
        <p>me component</p>
    )
}

export default Me;
